import React from 'react';
import { Card } from 'react-bootstrap';

function Footer(props) {
    return (
        <footer>
            <Card className='shadow-lg'>
                <h2>
                    THE GENERICS
                </h2>

            </Card>
        </footer>
    );
}

export default Footer;
